import React from "react";
import Jumbotron from "../../components/Jumbotron";

const Home = () => (
  <>
    <Jumbotron />
    <button to="/profile" exact ClassName="router-link-exact-active">
      Sign Up
    </button>
    <hr />
  </>
);

export default Home;
